import logo from './logo.svg';
import './App.css';
import Menu from './components/Menu';
import Home from './pages/Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Footer from './components/Footer';
import Background from './assets/20221013174526.png';
function App() {
  return (
    <div className='App' style={{backgroundImage:`url(${Background})`, backgroundColor:'black'}}>
      <Router>  
        <Menu />
        <Home/>
        <Footer/>
      </Router>
    </div>

  );
}

export default App;
